atom.value:
{REGEX='^[A-Za-z0-9_\.\-\+&]{1,30}$','The management class assigned to objects by the Archive Node.<p/>
				The TSM management class is used by the TSM server to apply rules for data location or retention after objects are stored to the TSM server by the Archive Node.<p/>
				Valid TSM management classes have 30 or fewer characters, are not case-sensitive, and include only the following characters: alphanumeric characters (A-Z, 0-9), . (period), - (hyphen), + (plus), &amp; (ampersand), and &#95; (underscore).'}
